INSERT INTO `news` (`new_id`, `title`, `content`, `createdAt`, `updatedAt`) VALUES
(1, 'Nous refaisons notre site web pour améliorer l\'expérience utilisateur 🖌️', 'Nous avons annoncé que nous allons refaire notre site web dans le but d\'améliorer l\'expérience utilisateur pour nos clients. Nous avons écouté les commentaires et les suggestions de nos clients et nous avons décidé de moderniser l\'apparence de notre site web, de rendre la navigation plus intuitive et de rendre les informations plus accessibles. Nous allons également améliorer les fonctionnalités de notre site web pour permettre à nos clients de faire des achats en ligne plus facilement et de suivre leur commande en temps réel. Nous croyons que cette refonte contribuera à améliorer la satisfaction de nos clients et à augmenter nos ventes. 🔥', '2023-01-29 20:12:32', '2023-01-29 20:12:32'),
(2, 'Campagne de marketing pour XYZ Inc. 💪', 'Nous avons annoncé que nous allions lancer une nouvelle campagne de marketing pour promouvoir nos produits auprès des consommateurs et renforcer notre marque. La campagne sera lancée sur différents supports, tels que les réseaux sociaux, les médias traditionnels et notre site web. Nous mettrons en avant les avantages et les bénéfices de nos produits pour les clients, ainsi que les témoignages de clients satisfaits. La campagne vise à accroître la notoriété de notre marque et à inciter les consommateurs à acheter nos produits.', '2023-01-29 20:13:30', '2023-01-29 20:13:30'),
(3, 'Nouveau bureau pour XYZ Inc. 🏢', 'Nous avons récemment ouvert des nouveaux bureaux dans une ville clé pour étendre notre présence sur le marché et mieux servir nos clients. Ces nouveaux bureau permettra de renforcer la présence de l\'entreprise dans cette région, de mieux répondre aux besoins locaux et de développer de nouvelles opportunités commerciales. Nous sommes enthousiastes à l\'idée de travailler dans ces nouveaux bureaux !', '2023-01-29 20:17:16', '2023-01-29 20:17:16'),
(4, 'Nouveau partenariat 🚀', 'Nous sommes ravis d\'annoncer notre nouveau partenariat avec une entreprise leader dans le domaine de la technologie. Ensemble, nous allons lancer une nouvelle gamme de produits innovants qui combineront les dernières technologies de notre partenaire avec nos compétences. Nous sommes convaincus que cette collaboration permettra d\'offrir des solutions encore plus performantes à nos clients. Le lancement de cette nouvelle gamme est prévu pour le prochain trimestre et nous sommes confiants que cela contribuera à la croissance de notre entreprise.', '2023-01-29 20:19:23', '2023-01-29 20:19:23');

